import colors from '../constants/ColorScheme';

const NavigationTheme = {
  dark: false,
  colors: {
    primary: colors.blue,
    background: colors.greyLighter,
    card: colors.greyLighter,
    text: colors.greyDarker,
    border: colors.greyLight,
  },
};

export default NavigationTheme;
